import {setState} from "react";
const axios = require("axios");

const Profile = () => {

    const userId = localStorage.getItem("user")
    const [favoritesList, setFavoritesList] = setState([]);

    const getFavorites = (id) => {
        axios.get(`http://localhost:3001/favoritesList/${id}`)
            .then(response => {
                setFavoritesList(
                    favoritesList.map((val) => {
                        return val.id === id
                        ? {
                            user: val.id,
                            name: val.name,
                            playlist: val.playlist,
                        } : val
                    })
                )
                console.log(response);

            })

    }

    return (
        <div>
            <h1>{userId}</h1>
            <h1>{getFavorites(userId)}</h1>
        </div>

    );


}

export default Profile;
